import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import 'bootstrap/dist/css/bootstrap.min.css';

//React-BS Button, Navbar
import { Button, Navbar, Nav, NavDropdown, Form, FormControl } from 'react-bootstrap'

class App extends Component {
    constructor(props) {
        super(props);
        this.state = { apiResponse: "" };
    }

    callAPI() {
        fetch("http://localhost:9000/testAPI")
            .then(res => res.text())
            .then(res => this.setState({ apiResponse: res }))
            .catch(err => err);
    }

    componentDidMount() {
        this.callAPI();
    }

    render() {
        return (
            <Navbar className="navbar" expand="lg">  {/*bg="light" >*/}
                {/*<Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>*/}
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Form inline>
                        <FormControl type="text" placeholder="Enter keyword..." className="mr-sm-2" />
                        <Button variant="outline-success">Search</Button>
                    </Form>
                    <Nav className="mr-auto">
                        <Nav.Link href="#home" style={{ color: "#d2d2d4" }}>Home</Nav.Link>
                        <Nav.Link href="#link" style={{ color: "#9b9b9b" }}>World</Nav.Link>
                        <Nav.Link href="#link" style={{ color: "#9b9b9b" }}>Politics</Nav.Link>
                        <Nav.Link href="#link" style={{ color: "#9b9b9b" }}>Business</Nav.Link>
                        <Nav.Link href="#link" style={{ color: "#9b9b9b" }}>Technology</Nav.Link>
                        <Nav.Link href="#link" style={{ color: "#9b9b9b" }}>Sports</Nav.Link>

                        {/* <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                            <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                        </NavDropdown> */}

                    </Nav>

                </Navbar.Collapse>
            </Navbar>
        );
    }
}


export default App;
